import React from "react"

const styles = {
    body__filter: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },

    body__button: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        margin: '25px',
        border: '0',
        outline: '0',
        fontSize: '12px',
        padding: '10px',
        borderRadius: '12px',
        backgroundColor: '#EBECF0',
        textShadow: '1px 1px 0 #ffffff',
        width: '15%',
        boxSizing: 'border-box',
        appearance: 'none',
        color: '#61677C',
        transition: 'all 0.2s ease-in-out',
        cursor: 'pointer',
        fontWeight: '600',
    },
};

export default function TodoFilter(props) {
    let value = 0;

    return (
        <div style={styles.body__filter}>
            <button style={styles.body__button} className='body__buttonFil' onClick={value = 1}>All</button>
            <button style={styles.body__button} className='body__buttonFil' onClick={value = 2}>Active</button>
            <button style={styles.body__button} className='body__buttonFil' onClick={value = 3}>Completed</button>
        </div>
    )
}
